import React from 'react'

export const Card = ({data}) => {
  return (
    <>
    {
      (data)?(
        data.map(item=>{
          return(
            <div className='card'>
                <img src={`${item.thumbnail.path}.${item.thumbnail.extension}`} alt=''/>
                <div className='title'>
                    <h1>{item.name}</h1>
                </div>
            </div> 
          )
        })
      ):""
    }
       
    </>
  )
}
